exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog");return parseCatalog(`https://www.aabook.cc/chapterList-${bid}.html`,[/<p class="section_title">正文<\/p>\s*<ul class="section_list">(?<fragment>(?:\s*<li>\s*<a[^>]*>[^<]*<\/a>\s*<\/li>)+)/,/<a href="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)</g],{clientOptions:{...(options&&options.clientOptions)},preprocess:raw=>raw.replace(/<!--.+?-->/g,"")})};